import React from 'react';
import ReactDom from 'react-dom';

const TodoList = () => {
    const items = ['Learn React', 'Build an App']
    return (
        <ul>
            <li>
                {items[0]}</li>
            <li>
                {items[1]}</li>
        </ul>
    );
};

const AppHeader = () => {
    return <h1>
        My Todo List</h1>
}

const SearchPanel = () => {
    return <input placeholder="search"/>
}

const App = () => {
    return (
        <div>
            <AppHeader/>
            < SearchPanel/>
            <TodoList/>
        </div>
    )
}

ReactDom.render(
    <App/>, document.getElementById('root'));
